PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?birthplace WHERE {
  ?author dbo:nationality "American" ;
           dbo:authorship ?work .
  ?work dbo:title "El Deafo" ;
         dbo:creator ?author .
  ?author dbo:birthPlace ?birthplace.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?child WHERE {
  ?parent dbo:child <http://dbpedia.org/resource/Roger_III,_Duke_of_Apulia>.
  ?child dbo:parent ?parent.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?child WHERE {
  <http://dbpedia.org/resource/Duke_Philipp_of_Württemberg> dbo:children ?child.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?member WHERE {
  <http://dbpedia.org/resource/Burnt_by_the_Sun> dbo:bandMember ?member.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?professional ?musical_artist WHERE {
  <http://dbpedia.org/resource/Rod_Argent> dbo:profession ?professional.
  ?musical_artist dbo:birthName "$pacely".
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?war WHERE {
  ?war dbo:awardedTo ?person.
  FILTER(?person = <http://dbpedia.org/resource/Golden_Sword_for_Bravery>).
  ?war dbo:placeOfEvent ?entityInRussianEmpire.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?parent WHERE {
  <http://dbpedia.org/resource/Charles_I_of_Hungary> dbo:fathersFather ?father .
  ?father dbo:parents ?parent .
  FILTER(?parent IN (<http://dbpedia.org/resource/Royal_Family>, <http://dbpedia.org/resource/Hungarian_Royalty>))
}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?birthplace1, ?birthplace2 WHERE {
  ?governor a dbo:Politician ;
             dbo:governedState dbr:Virginia ;
             dbo:birthPlace ?birthplace1.
  ?awardee dbo:award dbr:Vince_Gilligan_Award ;
            dbo:birthPlace ?birthplace2.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?commander WHERE {
  <http://dbpedia.org/resource/2nd_Dragoon_Regiment_(France)> dbo:commander ?commander.
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?manager WHERE {
  ?season a dbo:SoccerSeason ;
           dbo:hasTeam <http://dbpedia.org/resource/SBV_Vitesse> ;
           dbo:manager ?manager .
  FILTER(?season = <http://dbpedia.org/resource/2020%E2%80%9321_SBV_Vitesse_season>).
}
UNION
SELECT ?manager WHERE {
  ?team a dbo:SoccerTeam ;
         dbo:name "VfL Bochum" ;
         dbo:manager ?manager .
}

PREFIX dbo: <http://dbpedia.org/ontology/>
SELECT ?predecessor WHERE {
  <http://dbpedia.org/resource/Myat_Hpone_Pyo> dbo:predecessor ?predecessor.
}
